  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a compilation of observations
  compiled by the Massachusetts Geological Survey, published as a Web feature service,
  a web map service, an ESRI service and as an Excel spreadsheet for the National
  Geothermal Data System.. The document contains 5 worksheets, including information
  about the template, notes related to revisions of the template, Resource provider
  information, the data, a field list (data mapping view) and a worksheet with vocabularies
  for use in populating the spreadsheet (data valid terms). Data from 19 observations
  are included. Fields in the data table include ObservationURI, WellName, APINo,
  OtherID, HeaderURI, Label, Owner, Field, County, State, OtherLocationName, LatDegree,
  LongDegree, SRS, LocationUncertaintyStatement, TectonicProvince, Source, DataType,
  SpudDate, Elevation, DrillerTotalDepth, DepthUnits, TimeSinceCirculation, WellDiameter,
  DiameterUnits, BHT, BHTCorrectedValue, TemperatureUnits, BTHCorrectionType, EqLog_MeasurementDate,
  EqLog_TotalDepth, AmbientTemperature, EqLog_TemperatureTop, EqLog_TemperatureMax,
  etc. \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
